import React from 'react';
import Chart from 'chart.js'


export default()=>{

let myDoughnutChart = new Chart(document.getElementById('my_chart'), {
  type: 'pie',
  data: {
    datasets: [{
      data: [20, 80],
      backgroundColor: ['rgba(82,199,197,1)', '#E5E5E5'],
      borderWidth: 1
    }]
  },
  options: {
    tooltips: {
      enabled: false
    }
  }
});
return (
  <canvas id="myChart" width="400" height="400"></canvas>

)
}
